  return (
    <>
      <Typography
        textAlign="center"
        marginTop={4}
        marginBottom={6}
        variant="h2"
      >
        Desserts
      </Typography>
      <RecipeGrid type={RecipeType.Desserts} />
    </>
  );
};

export default Desserts;
